    //const float baseNormal = 510;
    //const float baseBoss = 555;
    void AddMonsterTemplate(MonsterTemplate mt)
    {
        //血量公式,baseNormal * ( 1.27 + 等级/10 ) ;baseBoss * (5.25 + 等级/10 ) 
        //if (0 == mt.isBos)
        //    mt.hp = System.Convert.ToInt32(baseNormal * (1.27f + mt.level / 10));
        //else
        //    mt.hp = System.Convert.ToInt32(baseBoss * (5.25f + mt.level / 10));

        float curHP = mt.hp;
        curHP= curHP * (1 + mt.level / 50);
        mt.hp = System.Convert.ToInt32(curHP);
        mt.maxHP = System.Convert.ToInt32( mt.hp);
        mt.toHp = mt.hp;
        if(0==mt.isBos)
            mt.gold = mt.level * 50;
        else
            mt.gold = mt.level * 150;

        //float curDef = mt.def;
        //curDef = curDef * 1.1f;
        //mt.def = System.Convert.ToInt32(curDef);

        if (!dicMonsterTemplate.ContainsKey(mt.level)) dicMonsterTemplate.Add(mt.level, new List<MonsterTemplate>(8));

        dicMonsterTemplate[mt.level].Add(mt);

        dicAllMonsterTemplateById.Add(mt.id, mt);
    }

    public MonsterTemplate GetMonsterTemplateById(int id)
    {
        return dicAllMonsterTemplateById[id];
    }

    public List<MonsterTemplate> GetMonsterTemplateByLevel(int level)
    {
        return dicMonsterTemplate[level];
    }

    public void CheckTemplateIsOk()
    {
        for (int i = 1; i <= maxMonsterLevel; i++)
        {
            if (dicMonsterTemplate[i].Count < 1)
            {
                Debug.LogError("Monster error,i:"+i.ToString());
            }
        }
    }
